text:
@Corfo cumplió 85 años y tenemos grandes motivos para celebrar con el anuncio de la creación de la Startup Campus, un espacio de colaboración entre el mundo público y privado para impulsar el talento chileno en el desarrollo de emprendimientos de base científico-tecnológicos. 

Este proyecto será ejecutado por la Fundación Chile y apoyará a 200 startups de alto potencial de crecimiento.

@Corfo fue, es y será fundamental para abrir paso a un futuro de grandes logros y tiene una de las llaves para el progreso de nuestro país. Chile puede más y juntos podemos más.

#INCENDIOS

De manera incansable continúa labor de equipos técnicos y brigadistas de CONAF, y recursos aéreos, en el combate de los incendios, especialmente estos últimos días. Trabajo en terreno de manera coordinada con Bomberos y distintos equipos de emergencias.

